import * as React from "react";
import { Button, StyleSheet, Text, View } from "react-native";
import { BaseButton } from "react-native-gesture-handler";
const HomeTab = (props) => {
  return (
    <View style={styles.container}>
      <Text style={styles.header}>Upload Document</Text>
      <Text style={styles.text}>1. Document Type</Text>
      <Text style={styles.text}>2. Copies </Text>
      <Text style={styles.text}>3. Urgent Service </Text>
      <Text style={styles.text}>4. Upload File</Text>
      <Text>
        <Button style={styles.button} title="Submit" />
      </Text>
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "white",
  },
  header: {
    fontSize: 24,
    fontWeight: "bold",
  },
  text: {
    flex: 1,
    fontSize: 20,
  },
  button: {
    paddingBottom: 4,
  },
});
export default HomeTab;
